import styled from "styled-components";

const Body = styled.div`
  max-width: 100vw;
`;
const Container = styled.div`
  height: 100vh;
  position: relative;
  padding-left: 2em;
  padding-right: 2em;
`;

const Layout = {
  Body,
  Container,
};

export default Layout;
